import { config } from '@gluestack-ui/config';
import { useAuth } from '../Context/AuthContext';
import { useState, useEffect } from 'react';
import axios from 'axios';
import { Box, GluestackUIProvider, Text, Center, VStack, Heading, Input, InputField, Button, ButtonText, Icon, Image} from '@gluestack-ui/themed';
import { useNavigation } from '@react-navigation/native';


function Products  (){

    const [products, setProducts] = useState([]);

    useEffect(() => {
        // Realizar la solicitud a la API
        axios.get('http://127.0.0.1:8000/api/products')
          .then(response => {
            // Almacenar los productos en el estado local
            setProducts(response.data);
          })
          .catch(error => {
            console.error('Error fetching products:', error);
          });
      }, []); // La dependencia vacía significa que este efecto se ejecutará solo una vez al montar el componente
    


    return(
        <>
     <Center>
  <Box></Box>
</Center>

        </>
    );
}

export default Products;
